INSERT INTO `news` (`id`, `category_id`, `title`, `seo_title`, `title_color`, `custom_attribute`, `author`, `source`, `keyword`, `abstract`, `content`, `hits`, `sort`, `add_time`, `path`, `display`, `relation`) VALUES
(49, 185, '千万别这样接信审电话，否则贷款被拒！', '信审电话贷款被拒', '', 'c', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;电话审核作为贷款中最重要的环节，它决定着这一笔贷款是否发放给借款人。所以，借款人如果不配合&ldquo;接电话&rdquo;的环节，是不能获得贷款的。常见有下面这几条禁忌，在日常生活中，如果养成了这几类习惯，要记得改正，以免申贷变成了徒劳。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;千万别连续拒接两次&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　现在绝大多数的人都是在用智能手机，手机软件免不了装载手机管家等一些拦截电话骚扰的软件。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;"&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;img alt="" src="https://static.rong360.com/gl/uploads/allimg/180418/153-1P41Q00549613.jpg" style="border: 0px; vertical-align: middle; width: 450px; height: 299px;"/&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　然而拒接的问题往往出现在这里。信审的回访电话是没有经过这些软件官方认证的，而且多为座机，而借款人很多时候把信审回访电话当做是骚扰电话直接拒接，第二次再接收到同样电话就会拉进软件的拦截名单内，信审人员会将申请人主动拒接电话的行为，视作主动放弃本公司贷款，当然不给放款了。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　正确姿势：首先要保持电话畅通，其次，无论多忙，先接电话说明情况。如果漏接也没关系，24小时之内，他们还会再打给你。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;千万别语气差，态度横&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　有些人在现实生活中，非常的高调，所以在接听信审人员电话的时候，都是一副天下唯我独尊的样子。这样一来，即便你材料为真，信审员也会觉得你为人不可靠。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　正确姿势：需要帮忙，求人办事，不能做到低调至极，至少也该和颜悦色。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;千万别言辞闪烁，胡乱作答&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　电话审核，通常是信审员核查你所材料的真实性。如果你说话言辞闪烁，信审员可能觉得你是在弄虚作假，心虚。另外，听不清楚信审员的问题时，不要胡乱作答，更不要觉得好玩开玩笑调侃信审员。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　正确姿势：实事求是，客观作答，回答应该与申请材料保持一致。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;千万别说大实话&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　你可能觉得说实话，别人不是最爱听的吗？可是你的大实话信审员眼里，可能会是一个大风险。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　例如，回答的时说：我之前取得银行，被拒了，找民间借贷，利息又太高，没办法了只能在你们这里申请&hellip;&hellip;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　问题一：多次被拒，信审员一定会继续查询原因；&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　问题二：去过民间借贷，是否有隐性负债；&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　问题三：把我们当做最后的救命稻草，风险不可把控）&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　正确姿势：有问有答，不过份热情多说其他话，更不要自己挖坑自己跳！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;千万别虚报事实&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　自己的月收入是两千，接电话时就不要说收入5000！看似要向信审员透露你有隐藏收入，可是信审更会怀疑你有隐藏负债，或是资料造假的嫌疑。所以电话回访时一定要实事求是，千万别虚报事实。为什么这么说，因为资料造假，不仅显得你个人诚信有问题，还可能会有骗贷嫌疑。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　正确姿势：实事求是！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;千万别暴露不良嗜好&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　即便你有着不良的嗜好，也别让信审员知道！例如你接电话时，对方听到你在打麻将或是让人觉得有赌博嫌疑的声音，肯定会让信审怀疑，你在赌博。对于赌博、炒股、放贷这些风险极高，也有不良嗜好的人，贷款机构是不愿意放款给这样的客户的！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　从贷款联系人中一旦得知这样的信息一样贷款批贷不下来。被拒客户调查中超过80%的客户是因为在交流之中体现出不良信息或嗜好被拒贷。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 67, 0, 1528875894, 'uploads/2018/0613/20180613154545959506.jpg', 1, ''),
(48, 150, '贷款骗局又玩新花样，一分钱借不到还得倒贴不少钱！', '贷款骗局', '', 'c', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;自从现金贷新政落地，不少非法现金贷已无生存之地，原本以为市场已被净化，我等缺钱之辈终于能挑选合法合规产品了，此时又发现，有些非法现金贷，又多了一重新伪装&mdash;&mdash;小程序。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　简单点说，就是有一些非法现金贷通过小程序上线，继续放贷。因为小程序不需要写代码，开通成本非常低，所以这么做的非法现金贷，还不在少数。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　马小军同学最近就手欠了一回。因为想过年回家好好装个B，所以就想借一点网贷捯饬一下自己，于是乎在微信上搜索了一下贷款，结果就被某不良贷款小程序给坑了。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　貌似这个小程序是关联某微信公众号，客服表示先交300服务费，60秒以内下款6000，交完又说要600认证费才能下款，再交完还不下款，要退钱的时候对方却把他拉黑了。再次进入主页面，发现对方客服没有回应，申请下款也没有下文。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　你看，就这么赤裸裸的把他给骗了，900块钱眼睁睁拿不回来了。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　此处肯定有不少借款人都在排队吐槽，咱借点钱咋就这么不容易！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　来，别急，融360小编在这里总结了几种方案应对，大家稍安勿躁。相信融360小编，咱一出手，魔高一丈道咱就得高两丈！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="font-weight: 700;"&gt;　　1.拒绝相信&ldquo;黑户贷款&rdquo;&ldquo;秒下款&rdquo;等诱人字眼&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　一般来说，非法小程序为了吸引借款人注意，一定会通过这些字眼来诱惑大家关注并借款。所以可以时刻提醒自己，这些字眼背后并不是真实的下款，而可能是坑爹的陷阱，在真的遇到诱惑之时，能保持冷静，免遭毒手。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="font-weight: 700;"&gt;　　2.牢记利息是判断贷款是否合法的第一道关&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　有些非法小程序会诱导用户下载某贷款APP，且不论这种APP是否具备放贷资质，就动辄借3000一周要还3500这种年利率高达857%的贷款，就百分百不能碰。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　除了高利息之外，这些非法平台还以加快下款速度为由收取手续费、服务费等其他费用，而一旦出现逾期，逾期费用100元/日也并不鲜见。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="font-weight: 700;"&gt;　　3.贷款平台或产品名称要谨慎分辨&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　像一些明星产品如微粒贷，有些人在搜索的时候可能会发现出现N多个加有各种前缀后缀的微粒贷，那其实这些都不是微粒贷本尊，但贷款用户不一定能及时分辨，极有可能被某个冒牌小程序给骗了。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 1, 0, 1528875813, 'uploads/2018/0613/20180613154436190427.jpg', 1, ''),
(47, 150, '小额贷款陷阱大揭秘，教你快速识破借贷骗局！', '借贷骗局小额贷款', '', 'c', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;一直以来，有资金需求的人们首先想到的就是银行，随着小贷公司和互联网金融大潮的到来，现在很多的借款人开始尝试不同的贷款渠道，虽然贷款渠道的增加解决了部分借款人的资金问题，但是这其中也不乏有骗子机构。接下来，小编总结并列举出以下几种常见的小额贷款诈骗手段，希望能够帮助到大家。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　警惕低利息或贷款前缴纳各种费用的放贷机构。不法分子通过小招贴、手机短信、网络广告等方式广撒网，自称可为资金短缺者提供贷款，以低利息甚至无息、无担保等有利条件吸引受害者。当急用钱人与其联系后，不法分子就以需提前支付预付利息、保证金等为由要求受害者汇款，或是要求受害者向指定账户汇验资款，以证明还贷能力，从而实施诈骗，造成受害者经济损失。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;"&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;img alt="" src="uploads/ueditor/php/upload/image/20180613/1528875790893842.jpg" style="border: 0px; vertical-align: middle; width: 450px; height: 300px;"/&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　正规贷款公司一般是在给借款人发放贷款后，才会收取利息、手续费等费用，而不是在贷款前要求付费。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　不要相信几乎无门槛的机构。这类诈骗公司，主要通过QQ、微信等社交平台招揽客户，打着&ldquo;无抵押贷款&rdquo;的幌子吸引借款人，而且主要是那些资质不好的借款人，比如没有工作收入、没有抵押物等。要知道无抵押不等于无门槛。无抵押贷款基本准入条件为：年龄18-60周岁，信用良好，有稳定的工作及收入，有固定的住所。那种几乎没有门槛的机构，借贷风险大，切不可相信。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　为防止无抵押贷款被骗，造成经济损失，一定要通过正规途径进行申请。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　只需身份证贷款的要多注意了。好多小额贷款公司号称手续便捷，只需提供身份证，这样其实非常不安全，要提防他们拿你的身份证去干一些不合法的事。正规的贷款机构都需要提供收入证明等，这样才是合理的贷款形式，仅仅凭借身份证就能贷款，你感觉是占便宜了，其实是对你个人信息安全的不负责。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　身份证只是一个必须材料，个人想要申贷成功，还需要提交信用报告和工资流水等。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　提防提供贷款资料后对方要求在自己名下新开账户存款的。你给对方提供自己的具体贷款资料后，对方可能会要求你用自己的名字到指定银行开户，并表示会往新开账户中发放贷款。这里有一个陷阱，因为对方掌握了你的各种信息，款项一旦存入，对方就可使用各种办法将钱转出来。这是不法分子诈骗的一个常见手段。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　条件太过简单、额度太高、费用太少的这些贷款一般都不正常，大家要多留意。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　总之，天上没有掉馅饼的好事，遇到手续简单的，要多审查，别以为自己占了多大便宜。在没有确定对方是否是正规贷款机构之前，切记不要轻易填写个人信息，以确保个人信息的安全性，这是安全贷款的重要内容之一。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 28, 0, 1528875743, 'uploads/2018/0613/20180613154256785462.jpg', 1, ''),
(46, 150, '网贷逾期，真的会遇到上门催收吗？', '网贷逾期上门催收', '', 'c', '要借吗', '网络', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;有一位粉丝后台留言加我，问网贷欠钱逾期，催收电话说会上门，一问才知道只是欠了1500元，那么催收真的会为这1500元上门催收吗？&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　答案是会的，但是有前提！现总结归纳，有以下几点前提，希望能够帮助到大家！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　第一：催收上门，一般金额不会太少，如果逾期的金额像后台留言的妹子欠款1500元左右，催收会采取协商的方式与你进行沟通，比如可以免息或者减息&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　第二：一般催收上门已经不是网贷平台了，而是外包的催收服务，那么这个时候你就一定要向他们表明自己的还款意愿，不是恶意透支，只是目前没有还款能力，这一点尤其重要，千万不要不接电话或者手机关机换号码，否则催收可能会骚扰你的家人朋友。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;　　如果你已经逾期了&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　如果你现在已经逾期几个月了&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　要注意以下几点&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　1：接到自称是银行或者催收电话，你先要他工号，然后告诉他，你现在已经开始全程录音了，再跟他接着往下谈。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　2：要向对方表明，你有良好的还款意愿，并且愿意沟通协调，大家都能接受的还款计划，这个还款计划，一定要根据自己的实际情况来协商，切忌不可为了一时的应付而盲目许诺，否则二次逾期，后果会严重很多。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　而且还款计划，或者其他因素条件不是他说什么样就是什么样的，即使最后告到法院，你败诉了，法院判决也会酌情考虑的。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　3：如果催收过程中，有存在外围施压或者恐吓威胁的，你可以收集证据，必要时可以向银监会投诉，法院控告，现在都在说 &ldquo;文明催收，依法要账&rdquo;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　如果催收行为本身就不规范，法院也是不会支持的，如果催收找你的亲戚朋友，工作单位，你要明确的告诉催收，你是完全独立民事行为人，你的债务是你个人的，没有任何人有连带责任，不允许找除你之外的人非法要账&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　在此呼吁&ldquo;各位逾期或者面临即将逾期的朋友，不要被欲望支配消费，要贯彻理性消费，努力工作，债务总有还完的一天&rdquo;不要抱有其他任何侥幸的心理&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 190, 0, 1528875593, 'uploads/2018/0613/20180613154129355790.jpg', 1, ''),
(50, 186, '为什么有欠款的人，信用卡更容易提额？', '信用卡提额', '', 'c', '', '', '', '', '&lt;div class="bt_abs" style="margin: 19px 0px 0px; padding: 14px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;"&gt;&lt;p style="margin-top: 0px; margin-bottom: 10px; padding: 0px 0px 0px 10px; font-size: 18px; border-left: 3px solid rgb(94, 147, 235); height: 18px; line-height: 18px;"&gt;摘要：&lt;/p&gt;&lt;div class="bta_context" style="margin: 0px; padding: 0px; text-indent: 28px;"&gt;银行喜欢给欠款的人提升信用卡额度，是因为欠款的人有良好的还款记录，这样他在银行里就有了很好的信用记录，信用记录好的人，那么通过信用卡借款的额度也就提高了，这是正道。&lt;/div&gt;&lt;/div&gt;&lt;div class="txt" deep="2" style="margin: 0px; padding: 0px 20px; line-height: 29px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;"&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　银行喜欢给欠款的人提升信用卡额度，是因为欠款的人有良好的还款记录，这样他在银行里就有了很好的信用记录，信用记录好的人，那么通过信用卡借款的额度也就提高了，这是正道。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　跟所有的经济活动一样，只有流通才能创造新的价值。对于银行的信用卡来说，也只有用户经常使用，才能创造更多的经济效益。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　因为使用越多，也就是借款越多，那么银行能够得到的收益也就越多，这样信用卡才能真正给银行创造好的收益。如果用户都不使用信用卡，那么对于用户来说信用卡就是一个摆设，对于银行来说，这种客户增加数量并不能带来收益。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　而欠款的人，都是属于经常使用信用卡的人。这种人因为经常使用，对信用卡理解比较到位，也是经常能够及时还账，这样就带来的巨大的流量。这种流量，很容易给银行创造价值。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　而因为经常借款，而且能够及时还款，这一类客户在银行中，信用自然会提高。因为信用卡的信用，就是通过客户不断使用、不断还款积累起来的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　当然，这种经常使用，不仅仅是说买包香烟、买瓶水之类的，更多的是客户在购置大件耐用品时候刷卡消费的，比如彩电、冰箱、家具等大件消费品。这样很容易提高用户的信用卡消费，因为支出都是用于家庭开支。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　如果你跑赌场去刷信用卡，那么信用额度提升反而没有那么快。这与信用卡的消费场景也有很大的关系。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　总而言之，信用卡就是秉承银行的&ldquo;锦上添花&rdquo;理念，而不是&ldquo;雪中送炭&rdquo;义举，所以那些经常欠款并且从不逾期的卡友，往往更容易提额。&lt;/p&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 172, 0, 1528876166, 'uploads/2018/0613/20180613154959413638.jpg', 1, ''),
(51, 151, '着急用钱怎么办？临时身份证可以贷款吗？', '临时身份证贷款急用钱', '', 'c', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;办理贷款时，身份证可以说是必不可少的一项资料证明了。但总有些粗心鬼偏偏在自己急用钱需要贷款的时候，弄丢身份证。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;真实案例&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　福建的李女士最近有些着急，不久前，她看中了一套商品房，觉得房源和价位不错，就跟开发商签了合同，可是刚预订不久，她就发现一个非常麻烦的问题，她的身份证弄丢了，目前手里只有一张临时身份证，但是购房合同上约定的付款期限即将到期，她非常着急，不知道临时身份证可不可以办理贷款？&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;"&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;img alt="" src="https://static.rong360.com/gl/uploads/allimg/180413/153-1P41310455Q15.jpg" style="border: 0px; vertical-align: middle; width: 450px; height: 299px;"/&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　据银行个贷中心人士介绍，身份证丢失，需要办理临时身份证才能申请房贷，而临时身份证的有效期在3个月内，如果还在有效期，申请房贷是不受影响的。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　不同该业内人士也指出，住房按揭贷款对于身份证明材料的审核非常严格，如果结婚证、户口本、身份证上面的个人资料不一致都不能通过审核，所以用户一定要小心准备各式材料和证明。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;临时身份证，可以办理贷款吗？&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　在法律上，临时身份证的效力和身份证是等同的，一般我们无法提供身份证的时候，也会要求提供临时身份证明。临时身份证是可以办理贷款，临时身份证的有效期在3个月内，如果还在有效期，申请房贷是不受影响的。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　不过，用临时身份证申请贷款，还是要求申请人在本地有稳定的工作和收入，信用记录良好，有还款能力，必须要满足贷款机构的条件才可以办理贷款。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　不过，临时身份证造假成本低，审核难度大，一些放贷机构和审查员因为怕麻烦，也可能拒绝该项业务，由于各地情况和政策都不同，若要办理贷款业务，还是要详细咨询一下当地正规机构的专业人员。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;临时身份证，究竟要如何办理？&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　1、到户籍所在地派出所提交上述材料；&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　2、公安机关人员对材料审核无误后，进入人口信息数据库中以申领人公民身份证号码调取制证信息，按要求进行相应选项后，在专用材料上打印个人信息；&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　3、信息打印完毕后，进行裁切及塑封，填写临时居民身份证签发登记表；&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　4、填写完毕后，等待公安机关人员发放临时身份证。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;小编说&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: justify;"&gt;　　身份证一旦遗失，就得大费周章地挂失、重新拍照、办理临时证件，上班的时候还不得不请假去办理这些事务！所以宝宝们平时要小心保管证件，一旦丢失不仅耽误时间，若被不法分子利用，后果不堪设想啊。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 121, 0, 1528876235, 'uploads/2018/0613/20180613155109844176.jpg', 1, '');
INSERT INTO `news` (`id`, `category_id`, `title`, `seo_title`, `title_color`, `custom_attribute`, `author`, `source`, `keyword`, `abstract`, `content`, `hits`, `sort`, `add_time`, `path`, `display`, `relation`) VALUES
(52, 186, '浦发信用卡最强提额方法！最快！', '浦发信用卡快提额', '', 'c', '', '', '', '', '&lt;div class="bt_abs" style="margin: 19px 0px 0px; padding: 14px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;"&gt;&lt;p style="margin-top: 0px; margin-bottom: 10px; padding: 0px 0px 0px 10px; font-size: 18px; border-left: 3px solid rgb(94, 147, 235); height: 18px; line-height: 18px;"&gt;摘要：&lt;/p&gt;&lt;div class="bta_context" style="margin: 0px; padding: 0px; text-indent: 28px;"&gt;浦发银行很多人的感觉是不可思议，怎么突然提额了？还提那么多？&lt;/div&gt;&lt;/div&gt;&lt;div class="txt" deep="2" style="margin: 0px; padding: 0px 20px; line-height: 29px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;"&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　说起浦发银行，下卡6个月就可以提额，是一家很不错的银行的，但朋友的卡都提额了为什么自己的卡就是不提额？浦发银行很多人的感觉是不可思议，怎么突然提额了？还提那么多？&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　确实浦发的提额最不着边际，有卡友表示自己一直在用浦发卡，刷的少也没有分期，突然就给提额，从5W到12W，吓得他打电话问，银行回说信用好就给提了。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　猴子行果然名不虚传，但不是谁都有这位卡友的好运气，说起浦发的提额策略，一定要记住浦发银行是商业银行，要赚钱的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　浦发银行最快的提额方式 &mdash;&mdash; 分期&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　1.买分期产品&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　很多卡友应该都接到过浦发业务员的电话，告诉你买哪个哪个分期产品，之后可以提额，部分卡友表示实测有效，但是一般推荐的产品可能都有点坑，就看这个额度值不值得花钱了。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　浦发银行有个小浦商城，金宝随意逛了一下，里面东西应该算是比外面贵，说是免息，但很多都是提高价格卖了，比如一款VIVO手机提价500（对比官网）之后，12月免息，利率水平的话可以说在10%-15%左右，但苹果手机没有涨价，可能本身就贵吧。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　所以，如果你有添置一些物品的计划，可以去小浦商城看看，有没有合适的，这非常有助于提额。&lt;/p&gt;&lt;p style="text-align:center;margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;&amp;nbsp;&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　2.信用卡分期&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　分期还款一般建议大额分期，不要刷了一点点就分期，既浪费手续费，银行又觉得你穷。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　哪个月如果花费比较多，比如双十一，出去旅游，可以尽量把消费集中在一张信用卡上，之后还款的时候选择分期还款，让银行赚点利息。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　浦发银行作为一家商业银行，还是很乐意见到分期还款的，只要你信用没有什么问题，提额还是很速度的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　浦发提额误操作&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　说了这么多，支观还要提醒大家，尤其是羊毛党，过分撸浦发的羊毛会有危险，不仅提额困难，可能还会降额，一定要适中。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　1.经常刷大额，但从来不分期&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　经常刷大额的，尤其是整数，很容易被怀疑是不是在TX， 而且从来不分期还款，银行没有甜头可赚。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　一旦你的账号被怀疑上了，就会有降额的风险。但如果你偶尔分期一下，让他赚点利息钱，他可能也就睁眼闭眼了，而且也乐意给你提额&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　2.经常刷0.38费率&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　如果经常刷低费率的POS机，银行第一想的就是我赚不到钱，你是不是在TX？这样也很容易被降额，更不要说提额了。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　3.五倍积分撸太多&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　成倍积分不要撸太狠，银行的便宜不是那么好占的，今天让你狂撸积分，明天再给你大降额，有卡友的额度一夜之间就从48K降到6.8K，就因为他那段时间一直狂撸五倍积分。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　总之，猴子行提额，搞分期很有效果。另外，占银行便宜不能太过分，尤其是你想提额的时候。&lt;/p&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 176, 0, 1528876292, 'uploads/2018/0613/20180613155143135779.jpg', 1, ''),
(53, 186, '信用卡下卡后，这5件事一定要知道！来自银行的套路', '信用卡套路', '', 'c', '', '', '', '', '&lt;div class="bt_abs" style="margin: 19px 0px 0px; padding: 14px; font-size: 14px; line-height: 26px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;"&gt;&lt;p style="margin-top: 0px; margin-bottom: 10px; padding: 0px 0px 0px 10px; font-size: 18px; border-left: 3px solid rgb(94, 147, 235); height: 18px; line-height: 18px;"&gt;摘要：&lt;/p&gt;&lt;div class="bta_context" style="margin: 0px; padding: 0px; text-indent: 28px;"&gt;使用信用卡的重中之重，不管你怎么使用信用卡，一定不能不逾期。一旦有过逾期记录，不仅会在个人征信报告里保留5年，还会影响今后贷款买房、买车以及生活的各方面。&lt;/div&gt;&lt;/div&gt;&lt;div class="txt" deep="2" style="margin: 0px; padding: 0px 20px; line-height: 29px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;"&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　1、及时还款免逾期&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　使用信用卡的重中之重，不管你怎么使用信用卡，一定不能不逾期。一旦有过逾期记录，不仅会在个人征信报告里保留5年，还会影响今后贷款买房、买车以及生活的各方面。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　因此，用信用卡的人，及时还款很重要，事关个人征信清白，不是跟你开玩笑。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　2、信用卡背签&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　申请的信用卡下卡后，拿起信用卡，及时在信用卡背面签名。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　3、覆盖安全码&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　有卡没卡不打紧，只需要信用卡卡号、有效期、安全码，就能支付成功。不用我多说，安全码有多么重要。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　4、设置密码&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　设置并保存好信用卡密码，不泄露。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　5、关键日期要记牢&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　交易日：你实际刷卡消费、取现或转账的日期。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　入账日：银行把你的卡交易在账上的日期。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　账单日：银行每月定期对你的信用卡账户当期发生的各项交易、费用等进行汇总结算，并结计利息，计算当期总欠款金额和最小还款额，并邮寄对账单的日期。也就是，看你最近一段时间花了多少钱。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　到期还款日： 从账单日起至到期还款日之间的日期为免息还款日。一定要在还款日前还款，若超过此期限，你对于本期刷卡就不能享受免息消费啦！&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　套路防不胜防&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　有人早早办理了信用卡，熟知信用卡各种使用规则，玩卡玩得666；有人面对信用卡则总是持有怀疑态度，不敢办理。这也可以理解，因为信用卡是把双刃剑，用的好，能够获得便利的同时，薅到羊毛，用的不好，则一不小心就产生了费用，甚至逾期影响征信。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　银行在信用卡业务上也是&ldquo;套路&rdquo;满满，持卡人一不小心就容易中招。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　先说办卡环节&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　申请信用卡看似很简单，无论是线上申请还是线下申请，申卡人递交申请资料，等待银行审核就可以了。满足条件则发卡，不满足条件则被拒。但在这个过程中需要申请人注意的有以下几点：&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　（1）所办信用卡卡种要明确&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　不少人有过这样的经历，我明明申请的是一张白金卡，下来确是一张额度低的金卡；或者我申请的是一张联名卡，银行却给我发了标准卡。这是因为，银行可能觉得你的资质不适合申请一张白金卡，但又不想错过你这个客户，就降级下发了金普卡，或者你所选择卡种不是银行主推的卡种，银行为你调换成了他们主推的卡种。关于调配信用卡，有的银行是硬性的规定，有的则是可选择的，即申请人可以自己选择允不允许银行调配。这个在申卡时需要看清楚。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　（2）不开卡也收年费&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　一般情况下，新办的信用卡只有在开卡使用后才会产生年费，不开卡不收费，但是有一些高端卡及特殊材质的卡种只要办下来，即使不开卡也是会被收取年费的。这一点也需要大家在申请信用卡的时候就要问清楚，不要盲目办卡。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　再说说用卡环节&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　用卡的过程中，有不少业务是会产生手续费或者利息的，比如以下几项：&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　（1）按照最低还款额还款&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　到期还款日，全额还款有压力，银行一般允许你按照最低还款额还款，通常是还账单金额的10%左右。这看似能环节持卡人的还款压力，但是成本却很高，是要产生利息的。信用卡的利息是日息万分之五，且按照全额罚息的方式收取，即已还款部分和未还款部分都要收取利息。一般是按月复利，算下来，利息是非常高的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　（2）账单分期&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　银行打电话让你办理分期的时候，都会强调分期没有利息，但殊不知，办理账单分期却要承担高额的手续费。有人觉得分期手续费不高，下面，举例为大家算笔账。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　比如按照分12期，每期手续费0.61%来计算。假如你账单金额12000元，分12期偿还，那么每月的手续费是12000*0.61%=73.2元，一年手续费是878.4元。你以为年利率就是878.4/12000=7.32%，看起来还可以。但是你忽视了你每月都在还款，每还一期，本金是递减的。那么，简单地来算的话，你月均负责应该=（12000+11000+10000+9000+...+2000+1000）/12=6500元。那么，粗略计算，你的实际费率至少=878.4/6500=13.5%。这个实际年利率可是很高的了。怎么样，你是不是被银行的分期业务套路过？&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　（3）取现&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　信用卡取现不但有利息，且利息是自取现当日起就开始计收，而且还有手续费。各家银行的信用卡取现手续费不同，一般在取现金额1%-3%。整体算下来，这个费用也是蛮高的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px;"&gt;　　因此建议持卡人，在日常用卡过程中，一定要规避以上几个&ldquo;坑&rdquo;，不然就要被收取各种费用了。&lt;/p&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 21, 0, 1528876358, 'uploads/2018/0613/20180613155303233020.jpg', 1, ''),
(54, 186, '信用卡使用的不良习惯，是在说你吗？', '', '', '', '', '', '', '', '&lt;div class="bt_abs" style="margin: 19px 0px 0px; padding: 14px; font-size: 14px; line-height: 26px;"&gt;&lt;p style="margin-top: 0px; margin-bottom: 10px; padding: 0px 0px 0px 10px; color: rgb(51, 51, 51); font-size: 18px; border-left: 3px solid rgb(94, 147, 235); height: 18px; line-height: 18px;"&gt;摘要：&lt;/p&gt;&lt;div class="bta_context" style="margin: 0px; padding: 0px; text-indent: 28px;"&gt;说到信用卡，如今关于信用卡的优惠活动可谓是层出不穷，让人心动。可是同时，关于信用卡的负面新闻也不绝于耳，让不懂它的人心生疑虑，不敢靠近。&lt;/div&gt;&lt;/div&gt;&lt;div class="txt" deep="2" style="margin: 0px; padding: 0px 20px; line-height: 29px;"&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　说到信用卡，如今关于信用卡的优惠活动可谓是层出不穷，让人心动。可是同时，关于信用卡的负面新闻也不绝于耳，让不懂它的人心生疑虑，不敢靠近。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　有的人能轻松将信用卡玩得得心应手，也有的人用信用卡&ldquo;拆东墙，补西墙&rdquo;变成了可悲的&ldquo;卡奴&rdquo;。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　其实，信用卡能对人产生多大的效益或多大的损失，完全取决于使用者怎么对待它。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　所以今天，小编就想来和你们聊聊，信用卡使用的不良习惯和如何正确用卡。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　不良习惯1：卡多还不记清还款日&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　卡多不是你的错，你记不清账单日，还款日就是你的不对了。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　小编身边有朋友大大咧咧，偏偏还爱办卡，结果有几次都差点忘记最后还款日还款，可算没铸成大错。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　要知道记不住还款日和还款金额，不仅有可能损失利息，最重要的是会影响个人信用记录，还会增加被盗刷的风险。必须改!&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　不良习惯2：总按最低还款额还款&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　信用卡按照最低还款额(当期账单10%)还款虽然方便，暂时能减轻还款压力，但是会产生利息。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　而且大部分银行都是按照全额罚息的方式来计算利息，也就是你已还的金额也不享受免息期，而是自交易日至还款日征收利息。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　利滚利啊，而且是慢刀子割肉，让你还感觉不到心痛，所以自己的钱自己心疼，非必要时刻还是全款还款吧。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　不良习惯3：信用卡取现频繁&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　信用卡基本功能就是透支消费，银行再从中赚取交易手续费，所以鼓励持卡人刷卡消费，这个交易手续费都是由商户承担的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　但是信用卡取现不涉及商户了，所以银行只能从你们身上获取收入。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　也就是每次取现都会向你收取现手续费，一般是取现金额的0.5%-3%。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　而且，信用卡取现还不享有免息期，从取现当日或者次日就开始收利息了。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　以前我有同事就喜欢信用卡取现，后来我给他算了笔账，再也没见他取过了。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　说了几点使用信用卡的不良习惯，再来说说如何正确使用信用卡才能提高幸福感。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　技巧1： 根据消费习惯选择信用卡&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　信用卡按功能主题主要分为：旅游、女性、汽车、航空、购物、卡通、游戏、慈善等类。比如经常去超市或某个商场，可以选择其联名卡，可享受优惠、多倍积分等。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　如果经常坐飞机，可以选择一些航空公司的联名卡，这些卡可以消费积里程，达到一定的里程规定后，还可以申请免费机票，仓位升级等等。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　如果经常商务出差或者有一定消费能力人士，可以持有多张银行信用卡，一是在不同地方发挥各张卡作用，二是临时需要消费，不同银行信用卡总额可以满足需要。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　技巧2：信用卡积分，银行的羊毛不薅白不薅&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　当初办理信用卡的时候我们都知道信用卡在进行消费的时候是可以进行累计积分的，那么信用卡的积分能用来干什么呢?&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　1.兑换礼品&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　我们可以去信用卡的银行官网上查找信用卡积分的选项，这样就可以看到积分兑换的一些商品和商品的积分价格。当然，每个银行的商品可能都是不一样的，除实物以外，也会有一些商品劵、体验劵之类的。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　2.积分也可以到商场兑换礼品&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　这部分兑换，是由商户提供兑换，具体由商户说了算。积分抵现金，这是这几年新出来的方式，在银行合作商店中，会有兑换，刷积分可以当现金买东西的。不过，总的说来，还是要看信用卡的种类，有的信用卡可以兑换很多，有的少。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　3.兑换里程&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　有些信用卡的积分可以直接兑换里程，但是一般都需要你是航空公司的VIP用户。积分兑换的里程可以在你出差或者旅行的时候使用。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　技巧3：账单日过后刷卡生成下月账单&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　想变成资深卡神，首先就得有个好记性，我们要记住手里面每张卡的账单日和还款日，这样可以错开账单日刷卡，那么消费记录就可以记入下个月的账单啦。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　举个栗子，小编的信用卡每个月的账单日是10号，还款日是26号。如果我在本月9日刷卡被记账，那我在本月的26日就需要还款，这样实际的免息期就只有十几天。&lt;/p&gt;&lt;p style="margin-top: 20px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　而如果我在本月10号刷卡被记账的话，那么我就可以到下月的10日才生成账单，从而到下月的26日才需要还款。这有就相当于，银行多给了我们一个月的过渡期了，对于手头紧的朋友来说，还是很重要的。&lt;/p&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 149, 0, 1528876422, 'uploads/2018/0613/20180613155351253398.jpg', 1, ''),
(55, 151, '网贷黑户，就一定办不了银行贷款吗？', '黑户贷款', '', '', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;贷黑户一定影响银行征信吗？不一定！关键看申请过的网贷是否上银行征信，这一点其实很多人都很清楚了吧。不过小编还是要为不懂的朋友解释一下。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;那么到底什么是网贷黑户呢？&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　看完这个案例你就明白了&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　小张2017年12月刷信用卡消费3万元，到了还款日还不起，决定申请网络贷款准备以网贷养信用卡，多个网贷到期后欠钱不还，逾期时间长就被整个网络贷款平台拉黑了，再也借不到钱。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;"&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;img alt="" src="uploads/ueditor/php/upload/image/20180613/1528876901566683.jpg" style="border: 0px; vertical-align: middle; width: 450px; height: 357px;"/&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;简而言之&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　网贷黑户申请网上借款往往被秒拒，而银行征信是指中国人民银行征信中心管理的征信系统，其信用信息主要由各商业银行上报的贷款。或信用卡相关记录可视为官方征信机构。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　二者大多数情况下是没有关系的，因为绝大多数网贷记录都不上银行征信银行征信主要记录的是银行贷款和信用卡记录。也有有不少人借了很多网上借款都没还，在银行征信报告上都没有显示。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　同理，有些朋友银行征信黑户网贷信用却很好，两者并不关联。但是有些网贷产品（比如持牌机构）是上银行征信的，那这就麻烦了！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　据小编了解，越来越多的网贷公司都在努力实现&amp;quot;上征信&amp;quot;的目标。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　所以，如果借的网贷产品，同时上网贷征信和银行征信。那么，网黑就与银行征信有关！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;小编提醒：&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　现在网贷征信和银行征信，相互重叠和交叉趋势越来越明显。很多借款机构会同时查。银行征信和大数据网贷征信，万不得已还是不要搞黑自己的征信报告的好。无论网贷大数据征信，还是银行征信。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 159, 0, 1528876871, 'uploads/2018/0613/20180613160130521182.jpg', 1, ''),
(56, 151, '注意！4月贷款又出新套路，已有多人中招！', '套路', '', 'c', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;在&ldquo;史上最严网贷新规&rdquo;下,大量网贷平台相继停业、转型,但是披着民间借贷外衣的&ldquo;套路贷&rdquo;却依然层出不穷。假期归来，融360小编给你分析两种新出的网贷套路，大家提高警惕！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　&lt;span style="color: rgb(0, 0, 255);"&gt;&lt;span style="font-weight: 700;"&gt;　套路一：贷款前先买保险&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　融360小编看到视界网的消息：重庆的小鲁因为父亲生病急需用钱，想通过网上贷款申请一笔2万元的小额贷款。就在她上网查询如何申请小额贷款时，一个页面弹窗吸引了她。弹窗显示：某网络借贷平台可以在不需任何抵押，而且操作手续简单方便的情况下贷款给她。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　在线简单填写资料后，小鲁收到了一份贷款合同和一名工作人员的电话。对方称，为保证双方权益，小鲁需要先通过私人微信转账2000元，购买一份保险，这笔钱会在放款后1小时内返还。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　当然，小鲁交了这2000块钱。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　&lt;span style="font-weight: 700;"&gt;融360小编有话说：&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　融360小编在这里忍不住敲黑板提醒：&lt;span style="font-weight: 700;"&gt;千万别相信任何形式的贷前转账！什么买保险、保证金、手续费什么的，不都是变相的贷前转账吗？&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　这其实是无抵押贷款最常见的伎俩，贷款被骗受害人中，十有八九就是掉进了这个坑里。骗子抓住借款人急于求成，而常识缺乏的心理，第一步先取得信任，然后编织各种理由，提前收取借款人的费用，通常以材料费、保证金等由头忽悠借款人上钩，当借款人将钱打入对方账户以后，骗子完成一轮骗局，消失。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　无论是在哪一个金融平台上进行贷款申请，所有正规的单位都不会在放贷之前，提前收取任何费用，牢记这一点，可以避免90%的骗局。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;&lt;span style="font-weight: 700;"&gt;　　&lt;span style="color: rgb(0, 0, 255);"&gt;套路二：转账包装银行流水&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　小鲁的故事还没有结束，第一笔转账后，工作人员又表示需要小鲁再转3000元充当银行资金流水，完成后随贷款返还，理由是小鲁现在的资质里没有银行流水这一项，只要小鲁交上3000元，他们负责帮忙包装银行流水。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　小鲁又交了这3000块钱，但是她所申请的贷款依然没拿到。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　&lt;span style="font-weight: 700;"&gt;　融360小编有话说：&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　这种包装资质的套路也属于老酒装新瓶了，以前经常有朋友收到&ldquo;凭身份证，即可下款20万到50万。&rdquo;的诈骗短信内容。如果我们相信了他们的话，&lt;span style="font-weight: 700;"&gt;交纳了包装资质的手续费之后，结果就是贷款没到手，手续费先被骗走。&lt;/span&gt;&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　大家有所不知，如果采用虚假的资质包装去贷款，很可能触犯法律，涉嫌骗取贷款罪或者贷款诈骗罪。退一万步讲，就算法律不管，很多网贷公司的风控都是经过专业培训的，大家的套路，他们都很懂。&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　所以我们在填写资料的时候实事求是填写就好了，既不要想着去包装自己的资质，也不要花钱去做无用功。这次不过，以后就选择申请更符合自身条件的平台。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 158, 0, 1528876958, 'uploads/2018/0613/20180613160249425788.jpg', 1, ''),
(57, 185, '超火的网贷等级表，看看你是哪个等级？', '', '', 'c', '', '', '', '', '&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;Ⅰ 三千元之内，试着办的信用卡，白条，任性付，借花呗等其中一两个，偶尔确实周转不过来买点东西，或者是专门使用为了维护好更多的信用记录！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　Ⅱ 一万元之内，有着正规的金融平台，例如借呗信用卡，固定性的消费和还款。从没接到过催收电话，也没听说过逾期！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　Ⅲ 五万元之内，有着一小点压力，好几家信用卡，等好几家网络平台贷款像用钱宝，闪电借款这类，每次都是工资一到意思着还上利息，继续周转过来花，但维护得挺好，依然很少逾期！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　Ⅳ 十万以上，心累，拆东墙补西墙，信用卡，网贷，米房借条，借贷宝借条，朋友家人，应有尽有，结果自己的工资不够利息，每天都是还款日，朝思夕算，哪儿还有更好的口子一次性贷够十万分期，还掉所有小贷，再来慢慢还一个平台的十万！每天接催收电话，恨不得手机关机，亲戚朋友脸面丢光，征信一塌糊涂！&lt;/p&gt;&lt;p style="margin-top: 25px; margin-bottom: 0px; padding: 0px; line-height: 29px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; white-space: normal; background-color: rgb(255, 255, 255);"&gt;　　Ⅴ 五十万以上，对自己彻底失望，随时准备消失，哪怕是死亡！想翻身谈何容易？想着恐怕得要个十多年。家人，老婆孩子，呵呵，离婚了！失去多了，也觉得无所谓了。网贷并不重要，先放弃不管！但逾期了好几个月的那些信用卡呢？不计较征信，脸面，老赖我认了，做不成飞机，我坐火车，做不成软卧，我坐硬座，但是这高利贷又咋办？罚息可是一天一天的长啊！&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 33, 0, 1528877025, 'uploads/2018/0613/20180613160406185471.jpg', 1, '');
